import 'Articles.dart';class NewModel {  NewModel({    this.status,    this.totalResults,    this.articles,  });  NewModel.fromJson(dynamic json) {    status = json['status'];    totalResults = json['totalResults'];    if (json['articles'] != null) {      articles = [];      json['articles'].forEach((v) {        articles?.add(Articles.fromJson(v));      });    }  }  String? status;  num? totalResults;  List<Articles>? articles;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['status'] = status;    map['totalResults'] = totalResults;    if (articles != null) {      map['articles'] = articles?.map((v) => v.toJson()).toList();    }    return map;  }}